// @ts-nocheck

import { useContext } from "react";
import logo from "../assets/logo.png";
import logoDark from "../assets/logo-dark.png";
import { CartVisibleContext } from "./Header";

const svgClass = "h-16 w-16";
const pathClass = "fill-green-3";

export function Logo({
  dark = false,
  fullSize = false,
}: {
  dark: boolean;
  fullSize: boolean;
}) {
  if (fullSize)
    return (
      <div className="flex items-center">
        <img src={dark ? logoDark : logo} alt="PC logo" className="h-20 w-20" />
        <div>
          {dark ? (
            <>
              <h1 className="text-xl font-bold text-green-2">PC Levelling</h1>
              <p className="text-xs font-semibold text-green-2">
                Level up your PC
              </p>
            </>
          ) : (
            <>
              <h1 className="text-xl font-bold text-green-3">PC Levelling</h1>
              <p className="text-xs font-semibold text-green-3">
                Level up your PC
              </p>
            </>
          )}
        </div>
      </div>
    );
  else
    return (
      <div className="flex items-center">
        <img
          src={dark ? logoDark : logo}
          alt="PC logo"
          className="h-16 w-16 sm:h-20 sm:w-20"
        />
        <div>
          {dark ? (
            <>
              <h1 className="text-sm font-bold text-green-2 sm:text-xl">
                PC Levelling
              </h1>
              <p className="text-xs font-semibold text-green-2">
                Level up your PC
              </p>
            </>
          ) : (
            <>
              <h1 className="text-sm font-bold text-green-3 sm:text-xl">
                PC Levelling
              </h1>
              <p className="text-xs font-semibold text-green-3">
                Level up your PC
              </p>
            </>
          )}
        </div>
      </div>
    );
}

type CartIconProps = { items: number };

export function CartIcon({ items }: CartIconProps) {
  const { setCartVisible } = useContext(CartVisibleContext);

  return (
    <button
      onClick={() => setCartVisible(true)}
      className="relative rounded-full p-2 hover:bg-white-2"
    >
      <svg
        viewBox="0 0 24 24"
        fill="none"
        xmlns="http://www.w3.org/2000/svg"
        width="24"
        height="24"
      >
        <path
          d="m3.5 3 1.033 3.194m0 0 1.582 6.59a3 3 0 0 0 2.917 2.3h6.403a3 3 0 0 0 2.91-2.273l1.344-5.374a1 1 0 0 0-.97-1.243H4.533Z"
          stroke="#375437"
          strokeWidth="1.8"
          strokeLinecap="round"
        ></path>
        <path
          d="M8.39 17.252a1.333 1.333 0 1 1 1.886 1.885 1.333 1.333 0 0 1-1.885-1.885ZM14.613 17.252a1.333 1.333 0 1 1 1.885 1.885 1.333 1.333 0 0 1-1.885-1.885Z"
          fill="#375437"
        ></path>
      </svg>
      <div className="absolute bottom-0 right-0 h-5 w-5 rounded-full bg-[#171615] text-sm text-[#ffffff]">
        {items}
      </div>
    </button>
  );
}

export function PlainCartIcon() {
  return (
    <svg
      viewBox="0 0 24 24"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      width="24"
      height="24"
    >
      <path
        d="m3.5 3 1.033 3.194m0 0 1.582 6.59a3 3 0 0 0 2.917 2.3h6.403a3 3 0 0 0 2.91-2.273l1.344-5.374a1 1 0 0 0-.97-1.243H4.533Z"
        stroke="#ffffff"
        strokeWidth="1.8"
        strokeLinecap="round"
      ></path>
      <path
        d="M8.39 17.252a1.333 1.333 0 1 1 1.886 1.885 1.333 1.333 0 0 1-1.885-1.885ZM14.613 17.252a1.333 1.333 0 1 1 1.885 1.885 1.333 1.333 0 0 1-1.885-1.885Z"
        fill="#ffffff"
      ></path>
    </svg>
  );
}

export function Close({ color = "#000000" }: { color?: string }) {
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      width="800px"
      height="800px"
      viewBox="0 0 24 24"
      fill="none"
      className="h-6 w-6"
    >
      <g id="Menu / Close_MD">
        <path
          id="Vector"
          d="M18 18L12 12M12 12L6 6M12 12L18 6M12 12L6 18"
          stroke={color}
          strokeWidth="2"
          strokeLinecap="round"
          strokeLinejoin="round"
        />
      </g>
    </svg>
  );
}

